import React from "react";

function Header() {
  return (
    <header id="header">
      <nav>
        <ul>
          <li><a href="#intro">Home</a></li>
          <li><a href="#aboutme">About Me</a></li>
          <li><a href="#skills">Skill</a></li>
          <li><a href="#projects">Projects</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
